css:
.git-control .branches {
  width: 100%;
  margin-bottom: 15px;
}
.git-control .branches > .branch {
  margin: 0 0 0 16px;
  padding: 2px 5px;
  border-radius: 4px;
  position: relative;
}
.git-control .branches > .branch .info span {
  vertical-align: middle;
  line-height: 1.42857143;
}
.git-control .branches > .branch .info .icon.chevron-right {
  color: #5d6062;
  opacity: 0.5;
  vertical-align: middle;
}
.git-control .branches > .branch.active {
  color: #ffffff;
}
.git-control .branches > .branch.active .icon.chevron-right {
  color: #ffffff;
  opacity: 1.0;
}
.git-control .branches > .branch .right-info {
  position: absolute;
  right: 0;
  top: 1px;
  display: inline-block;
  color: #9d9e9f;
}
.git-control .branches > .branch .count i.icon {
  margin-left: 2px;
}
